GAL trans is a Moldovan carrier company that operates regular bus services from Moldova to Romania, Ukraine and Russia.

With the application from GAL Trans you can easily:
– choose a flight suitable for the requested date;
– check buses routes on the map;
– see buses’ photos;
– make a reservation with payment to the driver during the boarding;
– pay for the ticket online;
– get access to the history of all purchased tickets in the personal account
– make a quick ticket return in your personal account
– request information from support service.

GAL Trans has a large bus fleet that meets European standards.

The professional drivers team will make sure that your trip is as comfortable as possible.

GAL Trans - it's important, who you travel with!

Приложение TravelAsk сэкономит ваше время на принятии решений и поможет выстроить наилучший маршрут для путешествия, т. к. содержит следующую информацию:

- достопримечательности городов с адресом, геолокацией и живописными фото;
- готовые решения для прогулок по местности (доступны варианты прогулок разной длительности по городу и интересные маршруты по стране);
- советы от путешественников и местных жителей: куда пойти, что купить, где дешевле и пр.;
- блюда местной кухни с коротким описанием и фото;
- соседние города с сортировкой по удаленности от выбранного вами города и по популярности у пользователей для просмотра данной местности;
- полезную информацию о погоде и сезонности конкретного региона;
- конвертер валют;
- короткие, но информативные статьи с выжимкой полезных сведений о местной культуре, транспорте, безопасности, праздниках и многом другом;
- карту города с выборкой самых посещаемых и интересных ТОП-мест.

Понравившуюся информацию можно легко сохранить в “избранное” в приложении ТревелАск. Один клик — и все заметки у вас под рукой.

