The new TaxiClub application will help you book a taxi all over Moldova. A user-friendly application interface will help you easily place an order. It is designed for users of all ages to help them get the right information in any kind of situations. Get rid of the waste of time for explanations, where to meet you and where the destination point is. Just use one of the currently available options:
- address selection from the built-in catalog;
- search for the address on the Google Maps or/and Yandex Maps;
- book a car by pointing on the map.
Get permanent updates regarding  your order on the smartphone screen:
- distance from the start address to the destination point;
- the preliminary cost of the order;
- current status of the order;
- data on the assigned car;
- final check of the trip.
If necessary, use the option to communicate with the driver directly from the application.
Your choice is important for us, so we strive to improve your comfort when using our taxi services. Try the mobile application to call a taxi and make sure each of our interactions will become even more convenient and pleasant.

Uklon: More than a taxi


Uklon SuperApp is a Ukrainian service for online car ordering. It’s your multitool for convenient movement around the city and the country.


Download the Uklon app to do such things:
- Order a driver for a personal car;
- Send packages up to 20 kg without additional charge through the "Delivery" service;
- Go to another city of Ukraine;
- Quickly and conveniently order a car around the city;
- Manage the price of your trip;
- Pay by cash and non-cash payment method;
- Order a car for a trip with a pet;
- Choose additional services: non-smoking driver, English-speaking driver, meeting with a sign, etc.;
- Pre-order a car for a certain time;
- Have a fixed cost of trips;
- But the most important thing is that our technical support works 24/7 to help you at any moment.


The service already works in 28 cities of Ukraine: Kyiv, Kharkiv, Zaporizhzhia, Vinnytsia, Ivano-Frankivsk, Poltava, Odesa, Dnipro, Lviv, Mykolaiv, Mariupol, Kherson, Kryvyi Rih, Bila Tserkva, Chernivtsi, Khmelnytskyi, Lutsk, Rivne, Ternopil, Uzhhorod, Kremenchuk, Kamianske, Kropyvnytskyi, Cherkasy, Chernihiv, Sumy, Zhytomyr, Kamianets-Podilskyi.
*** Unfortunately, the service is temporarily unavailable in Mariupol and Kherson. Mariupol and Kherson are Ukrainian cities!


Move your world with Uklon!


